define('text!widgets/test.html',[],function () { return '<div class="books container">\r\n    <div class="row">\r\n        <div class="col-md-3">\r\n            <div class="hidden-print affix" role="complementary">\r\n                <ul class="nav" data-spy="affix" data-offset-top="60" data-offset-bottom="200">\r\n                    <li><a class="" href="#">11</a></li>\r\n                    <li><a class="" href="#">Troisième génération</a></li>\r\n                    <li><a class="" href="#">Déjà rêvé</a></li>\r\n                    <li><a class="" href="#">Requiem</a></li>\r\n                    <li><a class="" href="#">L\'offre spéciale</a></li>\r\n                </ul>\r\n            </div>\r\n        </div>\r\n        <div class="col-md-9">\r\n            <div>\r\n                <h1>Before/After Demo Task Force (BAD TF) Work Statement</h1>\r\n\r\n                <h2>Status</h2>\r\n                <p>This Work Statement for the Before/After Demo Task Force (BAD TF) (hereafter referred to as "Task Force") has been reviewed and approved by EOWG in its teleconference on 1 July 2005. <strong>This Task Force is closed since January 2012; the latest version of the work is available at <a href="http://www.w3.org/WAI/demos/bad/">http://www.w3.org/WAI/demos/bad/</a>.</strong></p>\r\n\r\n                <h2>Objectives</h2>\r\n                <p>The Task Force operates under the <a href="http://www.w3.org/WAI/EO/charter4.html">EOWG charter</a>.</p>\r\n                <p>The objective of the Task Force is to:</p>\r\n                <ul>\r\n                    <li>develop an EOWG Resource Suite demonstrating a "before" and "after" repair of a Web site for the purpose of increasing accessibility, and explaining the changes in the site, as described in the <a href="http://www.w3.org/WAI/EO/Drafts/retrofit/requ-basite.html">Requirements for Before/After Demo</a> document.</li>\r\n                </ul>\r\n\r\n                <h2>Communication</h2>\r\n                <p>The Task Force communications are publicly visible. Communication mechanisms for the Task Force include:</p>\r\n                <ol>\r\n                    <li>The Task Force mailing list&lt;public-wai-eo-badtf@w3.org&gt; and archives</li>\r\n                    <li>Weekly (or biweekly) Task Force teleconferences</li>\r\n                    <li>Monthly (or more frequently, as needed) Task Force updates and feedback in EOWG teleconferences</li>\r\n                    <li>BADTF Web page</li>\r\n                </ol>\r\n\r\n                <h2>Participation</h2>\r\n                <p>Task Force participants must be participants of EOWG; should be skilled in HTML, CSS, scripting, Web development, and WCAG; and must actively contribute to the work of the Task Force, including:</p>\r\n                <ol>\r\n                    <li>\r\n                        Minimum 4 hours per week of work on Before/After Demo (Task Force is intended to be short-term (approximately 3 months))<br>\r\n                    </li>\r\n                    <li>Remain current on Task Force&nbsp; mailing list and respond in a timely manner to postings on Task Force mailing list</li>\r\n                    <li>Participate in Task Force telephone meetings, or send regrets to the Task Force list</li>\r\n                    <li>Assist in preparing Task Force deliverables for discussion</li>\r\n                </ol>\r\n\r\n                <h2>W3C Team Leadership</h2>\r\n                <p>The Task Force facilitator is Shadi Abou-Zahra.</p>\r\n\r\n                <h2><a name="participants" id="participants">Participants</a></h2>\r\n                <p>Current BAD TF participants:</p>\r\n                <ul>\r\n                    <li>Eric Eggert (Yatil)</li>\r\n                    <li>Wilco Fiers (Accessiiblity.NL)</li>\r\n                    <li>Maik Wagner (MCWIWA)</li>\r\n                    <li>Michael Stenitzer (Wienfluss)</li>\r\n                    <li>Shadi Abou-Zahra (W3C/WAI)</li>\r\n                    <li>Sylvie Duchateau (BrailleNet)</li>\r\n                    <li>Thomas Jewett (CSULB)</li>\r\n                </ul>\r\n\r\n                <p>Previous BAD TF participants:</p>\r\n                <ul>\r\n                    <li>Andrew Arch (Vision Australia)</li>\r\n                    <li>Henny Swan (RNIB)</li>\r\n                    <li>Klaus Hartinger (Edelweiss Medienwerkstat)</li>\r\n                    <li>Liam McGee (GAWDS/Communis)</li>\r\n                    <li>Pasquale Popolizio (IWA-HWG)</li>\r\n                    <li>Shadi Abou-Zahra (W3C/WAI)</li>\r\n                    <li>Steven Faulkner (Vision Australia)</li>\r\n                    <li>Tanguy Loheac (BrailleNet)</li>\r\n                </ul>\r\n\r\n                <hr>\r\n                <p>Editor: Shadi Abou-Zahra (previously Judy Brewer)</p>\r\n                <p>Last updated: $Date: 2012/02/20 21:02:35 $</p>\r\n            </div>\r\n        </div>\r\n    </div>\r\n</div>';});

